import React from "react";
import Avatar from '@mui/material/Avatar';
import SpaIcon from '@mui/icons-material/Spa';
import { AppBar, Button, ButtonGroup, Box } from "@mui/material";
import Typography from '@mui/material/Typography';
import {green } from '@mui/material/colors';
import CartWidget from "./CartWidget";
import Logo from "./Logo";
import {Link} from 'react-router-dom'
import '../assets/css/navbar.css'

const pages = [
    { label: "Home", link: "/" },
    { label: "Checkout", link: "/checkout" },
    { label: "Contacto", link: "/contacto" },
    { label: "deportes", link: "/category/deportes" },
    { label: "fiesta", link: "/category/fiesta" },
];

export default function Navbar() {
    return (
        <AppBar  className="nav" position="static" style={{ backgroundColor: "green" }} color="secondary">
            <Box
                display="flex"
                justifyContent="center"
                alignItems="center"
                minHeight="10vh"
            >
                <Box
                    display="flex"
                    mt={2}
                    mb={2}
                    mr={10}
                >
                    <Avatar sx={{ width: 100, height: 100, bgcolor: green[600] }}><Logo /></Avatar>
                    <Typography
                        mt={4}
                        ml={2}
                        variant="h6"
                        noWrap
                        component="a"
                        sx={{
                            mr: 2,
                            display: { xs: 'none', md: 'flex' },
                            fontFamily: 'monospace',
                            fontWeight: 700,
                            letterSpacing: '.2rem',
                            color: 'inherit',
                            textDecoration: 'none',
                        }}
                    >
                        PLANTASACUATICAS.COM.AR
                    </Typography>
                </Box>
                <Button variant="contained" color="success"><Link to="/category/fiesta">Fiesta</Link></Button>
                <Button variant="contained" color="success"><Link to="/category/deportes">deportes</Link></Button>
                <Button variant="contained" color="success"><link to="/category/deportes"></link>Palustre</Button>
                <Button variant="contained" color="success"><link to="/category/deportes"></link>Piedra</Button>
                <Box marginLeft={25}><Button variant="contained" color="success" ><Link to=""><CartWidget/></Link></Button></Box>
            </Box>
        </AppBar>
    );
}
